import React, { lazy } from 'react';

const IntroPage = lazy(() => import('components/pages/IntroPage'))

const routes = [
    {
        path: '/IntroPage',
        component: IntroPage,
        exact: true,
        authRequired: false,
        layouts: [],
    },
    {
        path: '/IntroPage',
        component: IntroPage,
        exact: true,
        authRequired: false,
        layouts: [],
    }
];


export default routes;
